import React from "react";
import fb from "../images/Facebook.png";
import fbHover from "../images/Facebook-1.png";
import fbActive from "../images/Facebook-2.png";

export default function SocialBar() {
  return (
    <div className="social-icons">
      <img src={fb}></img>
      <img src={fb}></img>
      <img src={fb}></img>
    </div>
  );
}
